Setup commitlint.config.js. Conventional configuration: // commitlint.config.js module.exports = {extends: ['@commitlint/config-conventional']}; If you are using commitzen, make sure to add this in package.json: "config": { "commitizen": { "path": "./node_modules/cz-conventional-changelog" }
} Configure lefthook: # lefthook.yml # Build commit messages
prepare-commit-msg: commands: commitzen: interactive: true run: yarn run cz --hook # Or npx cz --hook env: LEFTHOOK: 0 # Validate commit messages
commit-msg: commands: "lint commit message": run: yarn run commitlint --edit {1}
